  return (
    <BrowserRouter>
      <Routes>
        <div className="App">
          <div className="app__body">

            {/* <Route exact path="/" element={}>
     </Route> */}
            <Sidebar />
            <Route exact path="/" element={<Chat />}>
            </Route>

            <Route path="/room/:roomId" element={<Chat />}>
            </Route>
            <Chat />


          </div>

        </div>
      </Routes>
    </BrowserRouter>
  );
}

export default App;

